const event = (state = {}, action) =>{
	switch(action.type){
		case 'ADD_EVENT':
			let event = state.event?state.event: [];
			event.push(action.event);
			alert('test');
			return [...state,{event: event}];
		default:
			return state;
	}
};

export default event;
